import styled from 'styled-components'

export const Wrapper = styled.div`
  overflow-y: none;

  position: relative;
  width: 100%;
  height: 100%;
  min-height: 100vh;

  display: flex;
  flex-direction: column;
`

export const Content = styled.div`
  display: grid;
  flex: 1 0 auto;
`
